import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="main_board" id='player_character'>
        <ul>
          <li id='str'>Strength:</li>
          <li id='dex'>Dexterity:</li>
          <li id='con'>Constitution:</li>
          <li id='int'>Intelligence:</li>
          <li id='wis'>Wisdom:</li>
          <li id='cha'>Charisma:</li>
        </ul>
      </div>

      <div className="main_board" id='player_story_board'>
        <div id="players_story">1</div>
        <textarea name="player_input" cols={50} rows={3}></textarea>
      </div>

      <div className="main_board" id='dm_story_board'>
      <textarea name="dm_input" cols={50} rows={3}></textarea>
      </div>
    </div>
  );
}

export default App;
